var that = transformers;
function drawGradientLine(origin, dest, innerRadius, outerRadius, colorRgba, options) {
  var marginV = Vector.create(grid.upperLeft);
  var originV = Vector.create(origin).multiply(grid.cellSize[0]).add(marginV);
  var destV = Vector.create(dest).multiply(grid.cellSize[0]).add(marginV);
  var d = destV.subtract(originV);
  var normal = Vector.create([
      -d.elements[1],
      d.elements[0]
    ]).toUnitVector();
  var strokeGradUpper = originV.add(normal.multiply(outerRadius));
  var strokeGradLower = originV.add(normal.multiply(-outerRadius));
  var transRgba = _.clone(colorRgba);
  transRgba[3] = 0;
  strokeGrad = {
    type: 'linearGradient',
    startPosition: strokeGradUpper.elements,
    endPosition: strokeGradLower.elements,
    colorStops: [
      {
        position: 0,
        color: 'rgba(' + transRgba.join(',') + ')'
      },
      {
        position: innerRadius / outerRadius,
        color: 'rgba(' + colorRgba.join(',') + ')'
      },
      {
        position: 1 - innerRadius / outerRadius,
        color: 'rgba(' + colorRgba.join(',') + ')'
      },
      {
        position: 1,
        color: 'rgba(' + transRgba.join(',') + ')'
      }
    ]
  };
  shapes = that.drawShape(_.extend({
    type: 'path',
    layer: 'light',
    strokeStyle: strokeGrad,
    lineWidth: 2 * outerRadius,
    points: [
      originV.elements,
      destV.elements
    ]
  }, options), shapes);
  fillGrad = {
    type: 'radialGradient',
    start: {
      position: originV.elements,
      radius: 0
    },
    end: {
      position: originV.elements,
      radius: outerRadius
    },
    colorStops: [
      {
        position: innerRadius / outerRadius,
        color: 'rgba(' + colorRgba.join(',') + ')'
      },
      {
        position: 1,
        color: 'rgba(' + transRgba.join(',') + ')'
      }
    ]
  };
  shapes = that.drawShape(_.extend({
    type: 'circle',
    layer: 'light',
    fillStyle: fillGrad,
    position: originV.elements,
    radius: outerRadius
  }, options), shapes);
  fillGrad = {
    type: 'radialGradient',
    start: {
      position: destV.elements,
      radius: 0
    },
    end: {
      position: destV.elements,
      radius: outerRadius
    },
    colorStops: [
      {
        position: innerRadius / outerRadius,
        color: 'rgba(' + colorRgba.join(',') + ')'
      },
      {
        position: 1,
        color: 'rgba(' + transRgba.join(',') + ')'
      }
    ]
  };
  shapes = that.drawShape(_.extend({
    type: 'circle',
    layer: 'light',
    fillStyle: fillGrad,
    position: destV.elements,
    radius: outerRadius
  }, options), shapes);
}
var shapes = {};
shapes = transformers.drawShape({
  type: 'rectangle',
  layer: 'mask',
  fillStyle: 'black',
  position: grid.upperLeft,
  size: transformers.gridSizeInPixels(grid),
  order: 0
}, shapes);
var maskOptions = {
    layer: 'mask',
    composition: 'destination-out',
    order: 1
  };
for (var i = 0; i < lightSegments.length; i++) {
  drawGradientLine(lightSegments[i].origin, lightSegments[i].destination, 30, 40, [
    255,
    255,
    255,
    lightSegments[i].intensity
  ], maskOptions);
}
for (var i = 0; i < lightSegments.length; i++) {
  drawGradientLine(lightSegments[i].origin, lightSegments[i].destination, 4, 6, [
    255,
    0,
    0,
    lightSegments[i].intensity
  ]);
}
return shapes;

reachedGoal.body:
for (var i in touchedCells) {
  var element = transformers.findGridElement(touchedCells[i], pieces);
  if (element && element.type === 'squarePrism')
    return true;
}
return false;

calculateRotationAngle.body:
var h = [
    mousePosition[0] - center[0],
    mousePosition[1] - center[1]
  ];
var omDistance = Math.sqrt(h[0] * h[0] + h[1] * h[1]);
var ratio = -h[1] / omDistance;
var angle = 0;
if (omDistance !== 0) {
  var absValueAngle = Math.acos(ratio) * 180 / Math.PI;
  if (h[0] <= 0) {
    angle = -absValueAngle;
  } else {
    angle = absValueAngle;
  }
}
return angle;

makeBoardShapes.body:
var that = transformers;
return boardShapes = _.map(boardPieces, function (piece) {
  return that.makeFilledRectangle(boardGrid, [
    piece.col,
    piece.row
  ], piece);
});

makeBoxShapes.body:
var that = transformers;
return boxShapes = _.map(_.range(boxedPieces.length), function (index) {
  return that.makeFilledRectangle(boxGrid, that.gridIndexToCell(index), boxedPieces[index]);
});

makeRotateShape.body:
return {
  type: 'circle',
  radius: 0.8 * boardGrid.cellSize[0],
  center: transformers.gridCellCenter(boardGrid, selectedCell),
  strokeStyle: 'white',
  lineWidth: 15,
  meta: 'rotate'
};

makeDetectableShapes.body:
var shapes = RW.concatenate(transformers.makeBoardShapes(boardGrid, boardPieces), transformers.makeBoxShapes(boxGrid, boxedPieces));
if (selectedCell) {
  var selectedPiece = transformers.findPieceAtCell(boardPieces, selectedCell);
  if (selectedPiece && transformers.pieceIsRotatable(selectedPiece, unrotatablePieceTypes))
    shapes.push(transformers.makeRotateShape(boardGrid, selectedCell));
}
return shapes;
